<p class="p4"><span class="s1"><strong><span class="Apple-converted-space">&nbsp; </span>VIII. MEC&Aacute;NICA DE LA PROMOCI&Oacute;N.&nbsp;</strong></span></p>
<p class="p3"><span class="s1">En la compra de $100.00 MXN o m&aacute;s de productos DURACELL gana premios al instante, adem&aacute;s acumula puntos por periodo para ganar un premio quincenal, al cierre de LA PROMOCI&Oacute;N el cliente con mayor acumulaci&oacute;n de puntos ser&aacute; el ganador del premio final.&nbsp;</span></p>
<p class="p2">&nbsp;</p>
<p class="p2">&nbsp;</p>
<p class="p4"><span class="s1"><strong>1.Registro.&nbsp;</strong></span></p>
<p class="p3"><span class="s1">Ingresa en a <a href="http://www.ganaduracell.com" target="_blank"><span class="s2">www.ganaduracell.com</span></a> realiza el registro de tus datos y crea una contrase&ntilde;a para acceder despu&eacute;s y seguir registrando m&aacute;s producto DURACELL. Los datos solicitados son:&nbsp;</span></p>
<p class="p13">&nbsp;</p>
<ul class="ul1">
<li class="li3"><span class="s1">Nombre Completo </span></li>
<li class="li3"><span class="s1">Edad </span></li>
<li class="li3"><span class="s1">Tel&eacute;fono Celular </span></li>
<li class="li3"><span class="s1">Correo electr&oacute;nico </span></li>
<li class="li3"><span class="s1">Crear contrase&ntilde;a </span></li>
<li class="li3"><span class="s1">Confirmar contrase&ntilde;a </span></li>
</ul>
<p class="p14">&nbsp;</p>
<p class="p3"><span class="s1">Una vez realizado el registro ingresa un ticket y la siguiente informaci&oacute;n:&nbsp;</span></p>
<p class="p15">&nbsp;</p>
<ul class="ul1">
<li class="li3"><span class="s1">Sucursal FRAGUA. </span></li>
<li class="li3"><span class="s1">Ingresa c&oacute;digo de barras del ticket de compra. </span></li>
<li class="li3"><span class="s1">Ingresa c&oacute;digo de barras Duracell.</span></li>
<li class="li3"><span class="s1">De las opciones que presenta el sitio web selecciona la cantidad y el producto DURACELL que compraste.</span></li>
</ul>
<p class="p1"><span class="s1"><strong>Da clic en guardar y descubre el beneficio al instante. </strong></span></p>
<p class="p2">&nbsp;</p>
<p class="p3"><span class="s1">Es importante que los participantes conserven sus tickets de compra hasta el final de la promoci&oacute;n, ya que en caso de resultar ganadores deber&aacute;n presentar los tickets originales, mismos que ser&aacute;n sometidos a validaci&oacute;n. Participan tickets de compra a partir del 1ro de diciembre de 2018 y hasta el 31 de enero de 2019. Se cerrar&aacute; horario de participaci&oacute;n el 31 de enero de 2019 a las 23:59.&nbsp;</span></p>
<p class="p2">&nbsp;</p>
<p class="p3"><span class="s1">Limitado a un ben&eacute;fico al instante por ticket de compra registrado. </span></p>
<p class="p2">&nbsp;</p>
<p class="p16">&nbsp;</p>
